"""
binarysearch.com :: All Sublists Sum
jramaswami
"""


class Solution:

    def solve(self, nums):
        MOD = pow(10, 9) + 7
        soln = 0
        left = 0
        right = len(nums) - 1
        M = len(nums)
        T = len(nums)
        while left <= right:
            x = (nums[left] * M) % MOD
            soln = (soln + x) % MOD
            y = 0
            if left != right:
                y = (nums[right] * M) % MOD
                soln = (soln + y) % MOD
            # print(f"{left=} {right=} {nums[left]=} {nums[right]=} {M=} {x=} {y=}")
            T -= 2
            M += T
            left += 1
            right -= 1
        return soln


def test_1():
    nums = [2, 3, 5]
    expected = 33
    assert Solution().solve(nums) == expected


